package com.springcore.ref;

public class A {
	
	private int q;
	private B ob;
	
	
	
	public int getQ() {
		return q;
	}
	public void setQ(int q) {
		this.q = q;
	}
	public B getOb() {
		return ob;
	}
	public void setOb(B ob) {
		this.ob = ob;
	}
	public A() {
		super();
		// TODO Auto-generated constructor stub
	}
	@Override
	public String toString() {
		return "A [q=" + q + ", ob=" + ob + "]";
	}
	
	
	

}
